export default function Login() {
  return (
    <div className="form">
        <form className="loginForm">
            <label>Email</label>
            <Input type="text" placeholder="Enter UserName "/>
            <label>password</label>
           <input type="password" placeholder="Enter Password"/>
            


        </form>
       
    </div>
  )
}
